import React from "react";
import '../App.css';
import $ from 'jquery';
import { Button } from "@material-ui/core";

export default function Register(){

    return(
        <div>
            <div className="reg-left-box">
                <div className="participateHead">
                    <h2>Who Can participate?</h2>
                </div>

                <div className="participatePara">
                    <h2>Open to students of Sri Lanka Institute of Information Technology (SLIIT), Who interest in joining Mozilla Campus Club of SLIIT.</h2>
                </div>
            </div>
            <img className="watermark" src="https://res.cloudinary.com/fitness-glory/image/upload/v1639484985/logo_icon-01_s6oex8.png"/>
        </div>
    )
}
